import {router} from "../Utils/router";
import Index from "../Pages/HomePage/Index"
import IndexAbout from "../Pages/AboutPage/Index"

export const RoutesData = {
    mains : [
        {
            url: router.home,
            component: Index,
            layout: "home",
        },
        {
            url: router.investor,
            component: IndexAbout,
            layout: "investor",
        },
    ]
}
